import React from "react";
import { createTheme, ThemeProvider } from "@mui/material";

const customTheme = createTheme({
  root: {
    fontFamily: "sans-serif",
  },
  palette: {
    background: {
      default: "#CDA169",
    },
    text: {
      primary: "#ffffff",
    },
    primary: {
      main: "#CDA169",
    },
    secondary: {
      main: "#926E50",
    },
  },
});

const App = () => {
  return <ThemeProvider theme={customTheme}></ThemeProvider>;
};

export default App;
